import React, { useState } from 'react'
import Orii from './assets/orii.svg'

const Home = props => {
    const [user, setUser] = useState({props})

    const submit = e =>{
        e.preventDefault();

        fetch('http://localhost:5000/login',{
            method: 'POST',
            body: JSON.stringify({ user }),
            headers: {'Content-Type': 'multipart/form-data'}
        }).then(res => res.json())
        .then(json => setUser(json.user))
    }

        return(
            <div className="login-bg">
            {/* Group contents container */}
            <div id='login-group'>
                <div id='logo-container'>
                <img id='logo' src={Orii} alt='orii-logo'></img>
                </div>

                <div id='form-container'>
                    <form onSubmit={submit} id='form-data'>
                        <label id='email'>Email</label>
                        <input className='cus-input'
                        type='text'
                        name='user[email]'
                        placeholder='Email'
                        onChange={e => setUser({ ...user, name: e.target.value })}
                        ></input>
                        <label id='email' name='user[name]'>Password</label>
                        <input className='cus-input'
                        name='user[password]'
                        type='text'
                        placeholder='Password'
                        onChange={e => setUser({ ...user, name: e.target.value })}
                        ></input>
                        {user.errors.name && <p>{user.errors.name}</p>}
                        <input id='submit-btn' type='submit' value='Submit'></input>
                    </form>
                    <div id='sign-up-link'>
                        <div className='links' id='sign-up'><a href='/'>Sign up</a></div>
                        <div className='links'><a href='/'>Forgot password</a></div>
                    </div>

                </div>
            </div>



            </div>
        )
}

export default Home;
